import Router from 'next/router';

const Users = (props) => {
  return (
    <ul className='list-group'>
      {props.users.map((user) => (
        <li className='list-group-item list-group-item-action d-flex justify-content-between align-items-center' key={user.id} onClick={e => Router.p}>
          <div>
            <h5>
              {user.first_name} {user.last_name}
            </h5>
            <p>Email: {user.email}</p>
          </div>
          <img src={user.avatar} alt={user.first_name + user.last_name} style={{ borderRadius: '50%' }} />
        </li>
      ))}
    </ul>
  );
};

export default Users;
